import React from 'react';
import {Link} from 'react-router-dom'

function Navlist (props) {
  return (
    <div>

        <a className="navbar-item" href>
        <Link to={props.linkTo}>
          {props.linkName}
          </Link>
        </a>

    </div>
  );
}

export default Navlist;
